import { GET_CLIENTS } from "../actions/actionTypes"

const initState={
    clients:[]
}

export const reducer=(state=initState , action)=>{
    switch(action.type){
        case GET_CLIENTS:
            return{...state,clients:action.payload}
        default:return state
    }
}
